INSERT INTO `type` VALUES (6306,'分类投放可回收物时，应尽量保持清洁干燥，避免污染。其中：废纸应保持平整；|立体包装物应清空内容物，清洁后压扁投放；|废玻璃制品应轻投轻放，有尖锐边角的应包裹后投放。','指废纸张、废塑料、废玻璃制品、废金属、废织物等适宜回收、可循环利用的生活废弃物。',NULL,'可回收物',3),(6307,'分类投放有害垃圾时，应注意轻放。其中：废灯管等易破损的有害垃圾应连带包装或包裹后投放；|废弃药品宜连带包装一并投放；|杀虫剂等压力罐装容器，应排空内容物后投放；|在公共场所产生有害垃圾且未发现对应收集容器时，应携带至有害垃圾投放点妥善投放。','指废电池、废灯管、废药品、废油漆及其容器等对人体健康或者自然环境造成直接或者潜在危害的生活废弃物。',NULL,'有害垃圾',3),(6308,'湿垃圾应从产生时就与其他品种垃圾分开收集，投放前尽量沥干水分，其中：有包装物的湿垃圾应将包装物去除后分类投放；|包装物应投放到对应的可回收物或干垃圾收集容器；|盛放湿垃圾的容器，如塑料袋等，在投放时应予去除。','即易腐垃圾，指食材废料、剩菜剩饭、过期食品、瓜皮果核、花卉绿植、中药药渣等易腐的生物质生活废弃物。',NULL,'湿垃圾',3),(6309,'干垃圾应投入干垃圾收集容器，并保持周边环境整洁。','即其它垃圾，指除可回收物、有害垃圾、湿垃圾以外的其它生活废弃物。',NULL,'干垃圾',3),(6310,'分类投放可回收物时，应尽量保持清洁干燥，避免污染；|废纸应保持平整；|立体包装物应清空内容物，清洁后压扁投放；|废玻璃制品应轻投轻放，有尖锐边角的应包裹后投放。','主要包括废纸，废塑料，废金属，废玻璃、废织物等。',NULL,'可回收物',46),(6311,'投放有害垃圾时应注意轻放，废灯管等易破损的有害垃圾应连带包装或包裹后投放；|废弃药品宜连带包装一并投放；|杀虫剂等压力罐装容器，应排空内容物后投放；在公共场所产生有害垃圾且未发现对应收集容器时，应携带至有害垃圾投放点妥善投放。','主要包括废电池、废荧光灯管、废温度计，废血压计，废药品及其包装物，废油漆、溶剂及其包装物，废杀虫剂、消毒剂及其包装物，废胶片及废相纸等。',NULL,'有害垃圾',46),(6312,'餐厨/厨余垃圾从产生时就与其他类别垃圾分开归类，去除食材食品的包装物，不得混入纸巾餐具、厨房用具等；|厨余垃圾（餐厨垃圾）应滤去水分后投放。','主要包括餐厨垃圾、居民厨余、果蔬垃圾等。',NULL,'餐厨/厨余垃圾',46),(6313,'其他垃圾应投入其他垃圾收集容器，并保持周边环境整洁。','主要包括废旧家具等大件垃圾、陶瓷、灰土、卫生间废纸、污染的包装等难以回收的废弃物。',NULL,'其他垃圾',46),(6314,'可回收物实行单独分类，定点投放至可回收物收集容器。','是指未污染的适宜回收的可资源利用的生活垃圾，包括废纸、废塑料、废金属、废包装物、废旧纺织物、废弃电器电子产品、废玻璃、废纸塑铝复合包装等。',NULL,'可回收物',43),(6315,'有害垃圾根据不同品种分类投放至有害垃圾收集容器。','是指对人体健康或者自然环境造成直接或者潜在危害的生活垃圾，包括废电池（镉镍电池、氧化汞电池、铅蓄电池等），废荧光灯管（日光灯管、节能灯等），废温度计，废血压计，废药品及其包装物，废油漆、溶剂及其包装物。',NULL,'有害垃圾',43),(6316,'易腐（厨余）垃圾滤出水分后单独投放至易腐（厨余）垃圾收集容器。','指家庭、餐饮、机团单位食堂、集贸市场等产生的易腐性餐饮垃圾、厨余垃圾、废弃食材、废弃食物、废弃食用油脂等以及家庭产生的木竹、树枝、花草、落叶等。',NULL,'易腐（厨余）垃圾',43),(6317,'其它垃圾投放至其他垃圾收集容器。','是指除可回收物、易腐垃圾、有害垃圾以外的其他生活垃圾。',NULL,'其它垃圾',43),(6318,'用过的餐巾纸、尿片等由于沾有各类污迹，无回收利用价值，宜作为其他垃圾进行处理；|普通一次性电池（碱性电池）基本不含重金属，宜作为其他垃圾投放；|烟头等需要熄灭火种的垃圾，禁止直接带火投放到垃圾桶内','是指除可回收物、有害垃圾和厨余垃圾之外的，混杂、污染、难分类的其他生活垃圾。',NULL,'其他垃圾',1),(6319,'分类投放可回收物时，应尽量保持清洁干燥，避免污染；|废纸应保持平整；|立体包装物应清空内容物，清洁后压扁投放；|废玻璃制品应轻投轻放，有尖锐边角的应包裹后投放。','是指在日常生活中或者为日常生活提供服务的活动中产生的，已经失去原有全部或者部分使用价值，回收后经过再加工可以成为生产原料或者经过整理可以再利用的物品，包括废纸类、塑料类、玻璃类、金属类、织物类等。',NULL,'可回收物',1),(6320,'分类投放有害垃圾时，应注意轻放。|废灯管等易破损的有害垃圾应连带包装或包裹后投放；|废弃药品宜连带包装一并投放；|杀虫剂等压力罐装容器，应排空内容物后投放；|在公共场所产生有害垃圾且未发现对应收集容器时，应携带至有害垃圾投放点妥善投放。','是指生活垃圾中对人体健康或者自然环境造成直接或者潜在危害的物质，包括废充电电池、废扣式电池、废灯管、弃置药品、废杀虫剂(容器)、废油漆(容器)、废日用化学品、废水银产品、废旧电器以及电子产品等。',NULL,'有害垃圾',1),(6321,'去除食材食品的包装物，不得混入塑料袋、纸巾餐具、厨房用具等；|投放时要沥干水分，扎紧袋口；|垃圾桶应该盖好盖子，以免影响环境。','是指居民日常生活中产生的有机易腐垃圾，包括菜叶、剩菜、剩饭、果皮、蛋壳、茶渣、骨头等。',NULL,'厨余垃圾',1),(6322,'分类投放可回收物时，应尽量保持清洁干燥，避免污染；|其中：废纸应保持平整；|立体包装物应清空内容物，清洁后压扁投放；|废玻璃制品应轻投轻放，有尖锐边角的应包裹后投放。','是指在日常生活中或者为日常生活提供服务的活动中产生的，已经失去原有全部或者部分使用价值，回收后经过再加工可以成为生产原料或者经过整理可以再利用的物品，包括废纸类、塑料类、玻璃类、金属类、织物类等。',NULL,'可回收物',13),(6323,'分类投放有害垃圾时，应注意轻放；|废灯管等易破损的有害垃圾应连带包装或包裹后投放；|废弃药品宜连带包装一并投放；杀虫剂等压力罐装容器，应排空内容物后投放；|在公共场所产生有害垃圾且未发现对应收集容器时，应携带至有害垃圾投放点妥善投放。','是指生活垃圾中对人体健康或者自然环境造成直接或者潜在危害的物质，包括废充电电池、废扣式电池、废灯管、弃置药品、废杀虫剂(容器)、废油漆(容器)、废日用化学品、废水银产品、废旧电器以及电子产品等。',NULL,'有害垃圾',13),(6324,'去除食材食品的包装物，不得混入塑料袋、纸巾餐具、厨房用具等。投放时要沥干水分，扎紧袋口。垃圾桶应该盖好盖子，以免影响环境。','是指居民日常生活中产生的有机易腐垃圾，包括菜叶、剩菜、剩饭、果皮、蛋壳、茶渣、骨头等。',NULL,'厨余垃圾',13),(6325,'用过的餐巾纸、尿片等由于沾有各类污迹，无回收利用价值，宜作为其他垃圾进行处理；|普通一次性电池（碱性电池）基本不含重金属，宜作为其他垃圾投放；|烟头等需要熄灭火种的垃圾，禁止直接带火投放到垃圾桶内。','是指除可回收物、有害垃圾和厨余垃圾之外的，混杂、污染、难分类的其他生活垃圾。',NULL,'其他垃圾',13),(6326,'将大件垃圾投放至大件垃圾投放点；|将大件垃圾运送至集散点、处理设施进行投放；|通过电话或网络预约，由大件垃圾回收企业上门回收，单位等非生活区域应当自行将大件垃圾送至集散点、处理设施或者预约上门回收；|严禁将大件垃圾投放在其他生活垃圾收集点或随意丢弃在路边及其他隐蔽位置。','是指重量超过5kg或体积超过0.2m3或长度超过1m，且整体性强需要拆解或破碎后再利用或处理的废弃物。',NULL,'大件垃圾',13),(6327,'易拉罐、罐头盒应踩扁压实，金属尖利器物应用硬纸包裹捆绑后再投放至可回收物收集容器；||塑料瓶、塑料桶、塑料盒等应清除残留物并用水洗净、晾干（必要时压扁）后再投放至可回收物收集容器；|一次性塑料薄膜、塑料袋、食品袋分别投放至可回收物收集容器或其他垃圾收集容器；||废纸应折好压平，并用绳索捆牢，回收时应避免受到污染。旧书籍、刊物宜捐赠给有需要的人。一次性纸碟、墙纸、复写纸和被污染的纸巾、厕纸、未明确后续回收利用途径的复合材料包装物（如：牛奶盒和果汁饮料盒等）等应投放至其他垃圾收集容器；||废弃织物应捆牢后投放至废弃衣物回收箱或可回收物收集容器。用于捐赠的废弃织物，宜清洗干净，打包后自行送到民政部门设置的捐赠点；||废旧家用电器电子产品应投放至可回收物投放点或单独设置的收集容器内，不得自行拆解。对于已损坏的电器电子产品，不宜自行拆解投放，否则可能会造成危险，污染环境，应投放至可回收物收集容器，由专业机构拆解利用；||废旧家具不宜自行拆解应投放至大件垃圾投放点、处理设施，或预约上门回收；||玻璃容器应去掉瓶盖，撕掉瓶身标签，清除残留物并用水；||洗净、晾干后再投放至可回收物收集容器，防止破损。碎玻璃应先用纸包裹再用胶带缠好，投放至其他垃圾收集容器。','指适宜回收和资源利用的垃圾，包括纸类、塑料、玻璃、金属、织物、橡胶、家具、家用电器和电子产品及其他大件垃圾等。',NULL,'可回收物',32),(6328,'弃置药品及药具应尽量保持原包装，连同外包装一并投放至有害垃圾收集容器；||废杀虫剂、消毒剂、清洁剂、空调清洗剂、空气清新剂、废油漆、废矿物油等均应与容器一起密封投放；||废荧光灯管（不包括LED灯管）应保持完整、清洁、干燥，防止破损，投放至有害垃圾收集容器；|破碎的灯管应用纸张包裹并用胶带缠好，投放至指定其他垃圾收集容器；||废电池应保持完好，宜将残余电量耗尽再投放至有害垃圾；||收集容器，防止暴晒雨淋；|破损的电池应用透明塑料袋封装后再投放至有害垃圾收集容器。','指含有害物质，需要特殊安全处理的生活垃圾，包括对人体健康或自然环境造成直接或潜在危害的灯管、家用化学品和电池等。',NULL,'有害垃圾',32),(6329,'其他垃圾应袋装投放至其他垃圾收集容器，不应混入分类','指除可回收物、易腐垃圾、有害垃圾以外的其他生活垃圾。',NULL,'其他垃圾',32),(6330,'厨余垃圾宜用可降解的垃圾袋盛装，并去除食品包装及餐具制品等，沥干水分后密闭投放至厨余垃圾收集容器；|提供餐饮服务的社会单位应配置与餐厨垃圾收运车相匹配的收集容器，并定时交付给有资质的环卫作业单位，以便统一进行集中收运。','指家庭、餐饮、机团单位食堂、集贸市场等产生的易腐性餐饮垃圾、厨余垃圾、废弃食材、废弃食物、废弃食用油脂等以及家庭产生的木竹、树枝、花草、落叶等。',NULL,'厨余垃圾',32),(6331,'可回收物应尽量保持干燥干净，避免受到污染；|废纸应尽量保持平整，废纸箱应规整压平；|快递包装盒应去除胶带后投放；|立体包装物（瓶、罐、盒等）投放前，应清空内容物，尽量清洗干净、压扁；|废玻璃制品应轻投轻放，有尖锐边角的应包裹后投放；|尖锐的废金属制品应包裹后投放；|用于捐赠的旧衣物，清洗干净后，自行送到专门的捐赠点；|大块纸板、泡沫板等，不宜直接投入可回收物收集容器，应规整后置于投放点（收集容器旁）或预约上门收集；|废电器电子产品应尽量保持完整，不宜自行拆解；|大件垃圾不应随意堆放，应在指定的时间段投放到大件垃圾投放点，或通过电话、网络预约回收企业上门回收；|倡导按照材质属性对可回收物进行细分并投入可回收物智能回收箱或细分的可回收物收集容器。','适宜回收和资源利用的生活垃圾。',NULL,'可回收物',21),(6332,'有害垃圾投放时宜保持物品的完整性，并轻投轻放；|废荧光灯管、废含汞温度计等易破损的有害垃圾，应连带包装或包裹后投放；破损的废电池（如镉镍电池、氧化汞电池、铅蓄电池等）应采用透明塑料袋封装后再投放；|废油漆和废杀虫剂、清洁剂、空调清洗剂等均应与原容器一起密封投放；|废药品及其内包装应投放至有害垃圾收集容器或过期药品回收点。不接触或未沾染药品的纸盒等外包装可投放至可回收物收集容器；|在公共场所产生有害垃圾且未发现对应收集容器时，应将有害垃圾携带至设置有害垃圾收集容器的地点妥善投放。','含有害物质，需要特殊安全处理的生活垃圾。',NULL,'有害垃圾',21),(6333,'餐厨垃圾和厨余垃圾应从产生时就与其他类别垃圾分开归类，去除食材食品的包装物，不得混入纸巾餐具、厨房用具等。|餐厨垃圾中的废弃食用油脂，应单独存放、交付餐厨垃圾收集运输单位。|难以生物降解的贝壳、大骨头为厨余垃圾。毛发可作为其他垃圾投放。|餐厨垃圾和厨余垃圾应滤去水分后再投放。','餐厨垃圾指餐饮服务过程中产生的有机类生活垃圾。厨余垃圾指居民家庭日常生活、以及农产品市场产生的有机类生活垃圾。',NULL,'厨余垃圾',21),(6334,'其他垃圾应投入其他垃圾收集容器，并保持周边环境整洁。','除厨余垃圾、可回收物、有害垃圾之外的其他生活垃圾。',NULL,'其他垃圾',21),(6335,'投放可回收物时，应尽量保持清洁干燥，避免污染；|其中：废纸应保持平整；|立体包装物应清空内容物，清洁后压扁投放；||废玻璃制品和废旧电器电子产品应轻投轻放;|有尖锐边角的应包裹后投放。','指废弃的纸张、塑料、金属、纺织物、电器电子产品、玻璃等可资源化利用的物质。',NULL,'可回收物',20),(6336,'投放有害垃圾时，应注意轻放。其中：废灯管、水银温度计等易破损的有害垃圾应连带包装或包裹后投放；|废弃药品宜连带包装一并投放；|杀虫剂等压力罐装容器，应排空内容物后投放。','指废弃的充电电池、扣式电池、荧光灯管（日光灯管、节能灯等）、温度计、血压计、药品、杀虫剂、胶片及相纸等生活垃圾中对人体健康或者自然环境造成直接或者潜在危害的物质。',NULL,'有害垃圾',20),(6337,'厨余垃圾投放前尽量沥干水分，其中：有包装物的厨余垃圾应将包装物去除后分类投放;|包装物应投放到对应的可回收物或其他垃圾收集容器；|盛放厨余垃圾的容器，如塑料袋等，在投放时应予去除。','指废弃的剩菜、剩饭、蛋壳、瓜果皮核、茶渣、骨头在日常生活中产生的易腐性垃圾。',NULL,'厨余垃圾',20),(6338,'其他垃圾应投入其他垃圾收集容器，并保持周边环境整洁。','指除可回收物、厨余垃圾和有害垃圾之外的生活垃圾。',NULL,'其他垃圾',20),(6339,'纸类应尽量叠放整齐，避免揉团，纸板也应拆开叠放；||投放的牛奶利乐包等食品包装盒应折叠压扁；||投放瓶罐类物品应尽可能将容器内产品用尽或倒尽，并清理于净后投放；||玻璃类物品应小心轻放，以免割伤破损，最好是袋装或者用容器装好后投放；||干净完好的衣物可以通过捐赠，帮助有需要的人','可循环利用和资源化利用的纸张、塑料、金属、纺织物、电器电子产品、玻璃等。',NULL,'可回收物',17),(6340,'废旧灯管等易破损的有害垃圾应连带包装或包裏后投放；|废弃药品应连帯包装一并投放；|杀虫剂等压力罐装容器，应破孔后投放；|在公共场所产生有害垃圾且未发现对应收集容器时，应将有害垃圾携带至设置有害垃圾收集容器的地点妥善投放。','对人体健康或者自然环境造成直接或者潜在危害的废弃物，包括废电池（普通碱性电池除外），废荧光灯管（日光灯管、节能灯等），废温度计，废血压计，废药品及其包装物，废油漆、溶剂及其包装物，废杀虫剂、消毒剂及其包装物。',NULL,'有害垃圾',17),(6341,'厨垃圾应投放到专用的餐厨垃圾袋中；|餐厨垃圾水份多，易腐烂变质，散发臭气既影响小区环境，也容易在垃圾收运过程中出现污水滴漏问题，所以餐厨垃圾投放时���沥干水分，扎紧袋口；|倒完垃圾应将餐厨垃圾桶盖好，以免垃圾污染周围环境，蚊蝇滋生。','餐厨垃圾，是指居民日常生活及食品加工、餐饮服务、单位供餐等活动中产生的废弃物，以及农贸市场、农产品批发市场产生的腐烂蔬菜瓜果、腐肉、碎骨、蛋壳、畜禽产品内脏等。',NULL,'餐厨垃圾',17),(6342,'餐巾纸、尿片等由于水溶性或吸水性太强，无回收利用价值，宜作为其他垃圾处理；|木屑，坚果类果壳(如:花生壳、板栗壳、菱角売等)，用于燃烧，利用率更高，宜作为其他垃圾处理。','其他垃圾，是指除可回收物、有害垃圾和餐厨垃圾之外的其他生活垃圾。',NULL,'其他垃圾',17),(6343,'轻投轻放；|||清洁干燥，避免污染；|||废纸尽量平整；|||立体包装物请清空内容物，清洁后压扁投放；|||有尖锐边角的，应包裹投放','是指适宜回收和可循环再利用的废弃物。主要包括：废纸、废塑料、废金属、废纺织物、废玻璃、废弃电器电子产品、废纸塑铝复合包装等。',NULL,'可回收物',8),(6344,'充电电池、纽扣电池、蓄电池等投放时请注意轻放；|油漆桶等如有残留，请密封后投放；|荧光灯、节能灯等易破损的请连包装或包裹后轻放；|废药品应连带包装一并投放','是指对人体健康或者自然环境造成直接或者潜在危害的零星废弃物，单位集中产生的除外。主要包括：废电池（镉镍电池、氧化汞电池、铅蓄电池等），废荧光灯管（日光灯管、节能灯等），废温度计，废血压计，废药品及其包装物。',NULL,'有害垃圾',8),(6345,'纯流质的食物垃圾，如牛奶等，应直接倒进下水口；|请勿将牙签、纸巾塑料袋等杂物混入其中，有包装物的厨余垃圾应将包装物去除后分类投放，包装物请投放到对应的可回收物或其他垃圾收集容器','是指易腐蚀的生物质废弃物。主要包括：居民家庭日常生活中产生的食物残余和食品加工废料等易腐性垃圾；农贸市场、农产品批发市场等产生的蔬菜瓜果垃圾、腐肉、碎骨、蛋壳、畜禽产品内脏等易腐性垃圾。',NULL,'厨余垃圾',8),(6346,'尽量沥干水分；|难以辨识类别的生活垃圾投入其他垃圾容器内。','是指除有害垃圾、可回收物、厨余垃圾以外的其他生活废弃物：主要包括污损后不宜回收利用的包装物、餐巾纸、厕纸、尿不湿、竹木和陶瓷碎片等。',NULL,'其他垃圾',8),(6347,'废纸类：捆扎打捆进行投放；||废旧织物类：清洗干净，叠放整齐装袋进行投放；||金属类：塑料或金属瓶子用清水清洗干净压扁后投放','适宜回收和再生利用的生活废弃物，包括纸类、塑料、橡胶、玻璃、金属、纺织物等。',NULL,'可回收物',42),(6348,'投放时注意轻放；|如有残留请封闭后投放；|已破损请包装后再轻放。','含有害物质，需要特殊安全处理的生活垃圾，包括对人体健康或自然环境造成直接或潜在危害的过期药品、灯管、家用化学品和电池等。',NULL,'有害垃圾',42),(6349,'沥干水分去袋投放。','居民家庭日常生活过程中产生的菜帮、菜叶、瓜果皮壳、剩菜剩饭、废弃食物等垃圾。',NULL,'厨余垃圾',42),(6350,'尽量沥干水分；|难以辨识类别的生活垃圾投入其他垃圾容器内。','除有害垃圾、可回收物、厨余垃圾之外的生活垃圾。',NULL,'其他垃圾',42),(6351,'纸类应尽量叠放整齐，避免揉团，纸板也应拆开叠放；|投放的牛奶利乐包等食品包装盒应折叠压扁；|投放瓶罐类物品应尽可能将容器内产品用尽或倒尽，并清理干净后投放；|玻璃类物品应小心轻放，以免割伤破损，最好是袋装或者用容器装好后投放；|织物类应打包整齐后，定期投放到指定收集点。','是指适宜回收和资源化利用的生活垃圾。主要包括：未被污染的废纸，废塑料，废金属，废包装物，废旧纺织物，废弃电器电子产品，废玻璃，废纸塑铝复合包装等。',NULL,'可回收物',12),(6352,'废弃的荧光灯管灯泡投放时请打包固定，亦可使用新购荧光灯管灯泡包装物进行包装，以防止灯管灯泡破损以至有害的汞蒸气挥发到环境中；|在日常生活中，使用的电池种类很多，目前生产的一次性电池已实现低汞和无汞化，宜作为其他垃圾投放。','是指对人体健康或者自然环境造成直接或者潜在危害的废弃物。主要包括：废电池（镉镍电池、氧化汞电池、铅蓄电池等），废荧光灯管（日光灯管、节能灯等），废温度计，废血压计，废药品及其包装物，废油漆、溶剂及其包装物。',NULL,'有害垃圾',12),(6353,'厨余垃圾应投放到专用的厨余垃圾袋中；|厨余垃圾水分多，易腐烂变质，散发臭气，既影响小区环境，也容易在垃圾收运过程中出现污水滴漏问题，所以厨余垃圾投放时要沥干水分，扎紧袋口；|小区厨余垃圾桶应盖好盖，以免污染周围环境。','指日常生活中产生的易腐烂垃圾，如相关单位食堂、宾馆、饭店等产生的餐厨垃圾；居民区产生的厨余垃圾；农贸市场、农产品批发市场产生的蔬菜瓜果垃圾、腐肉、肉碎骨、蛋壳、畜禽产品内脏等。',NULL,'厨余垃圾',12),(6354,'用过的餐巾纸、尿片等由于沾有各类污染，无回收利用价值，宜作为其他垃圾进行处理；|普通一次电池基本不含重金属，宜作为其他垃圾投放。','指除可回收物、有害垃圾、湿垃圾以外的其它生活废弃物，包括砖瓦陶瓷、尘土、卫生间废纸、纸巾等难以回收以及暂无回收利用价值的废弃物。',NULL,'其他垃圾',12),(6355,'厨余垃圾应从产生时就与其他类别垃圾分开归类，去除食材食品的包装物，不得混入纸巾餐具、厨房用具等；|||餐厨垃圾中的废弃食用油脂，应单独存放、交付餐厨垃圾收集运输单位；|||难以生物降解的贝克、大骨头、毛发等，应作为其他垃圾投放；||厨余垃圾应滤去水分后再投放','包括餐厨垃圾和农贸市场、农产品批发市场等产生的易腐性垃圾。餐厨垃圾包括餐饮垃圾和厨余垃圾。餐饮垃圾是指公共机构和相关企业在食品加工、餐饮服务、单位供餐等活动中产生的食物残渣、食品加工废料和废弃食用油脂。',NULL,'厨余垃圾',10),(6356,'可回收物应尽量保持干燥干净，避免受到污染；|废纸应尽量捆扎并保持平整，废纸箱应规整压平;|快递包装盒应去除胶带后投放；|立体包装物（瓶、罐、盒等）投放前，应清空内容物，尽量清洗干净、压扁；|利乐包装盒需要剪开、简单冲洗、晾干、压平；|废玻璃制品应轻投轻放，有尖锐边角的应包裹后投放。尖锐的废金属制品应包裹后投放；|用于捐赠的旧衣物，需要清洗干净后，打包整齐，保持干燥、避免污染，自行送到专门捐赠点；|大块纸板、泡沫板等，不宜直接投入可回收物收集容器，应规整后置于投放点（收集容器旁）或预约上门收集；|废电器电子产品应尽量保持完整，不宜自行拆解。','是指适宜回收和资源化利用的生活垃圾。主要包括：未被污染的废纸，废塑料，废金属，废包装物，废旧纺织物，废弃电器电子产品，废玻璃，废纸塑铝复合包装等。',NULL,'可回收物',10),(6357,'有害垃圾投放时宜保持物品的完整性，并轻投轻放；|废荧光灯管、废含汞温度计等易破损的有害垃圾，应连带包装或包裹后投放；|破损的废电池（如镉锂电池、氧化汞电池、铅蓄电池等）应采用透明塑料袋封装后再投放；|废油漆和废杀虫剂、清洁剂、空调清洗剂等均应与原容器一起密封投放；|废药品及其内包装应投放至有害垃圾收集容器或过期药品回收点；|不接触或未沾染药品的纸盒等外包装可投放至可回收物收集容器；|在公共场所产生有害垃圾且未发现对应收集容器时，应将有害垃圾携带至设置有害垃圾收集容器的地点妥善投放；|其他垃圾或成分复杂难以分辨类别的生活垃圾，投入其他垃圾收集容器。','是指对人体健康或者自然环境造成直接或者潜在危害的废弃物。主要包括：废电池（镉镍电池、氧化汞电池、铅蓄电池等），废荧光灯管（日光灯管、节能灯等），废温度计，废血压计，废药品及其包装物，废油漆、溶剂及其包装物。',NULL,'有害垃圾',10),(6358,'其他垃圾或成分复杂难以分辨类别的生活垃圾，投入其他垃圾收集容器。','指除可回收物、有害垃圾、湿垃圾以外的其它生活废弃物。',NULL,'其他垃圾',10),(6359,'可回收物进行分类投放时，应尽量保持清洁干燥，避免污染；||废纸应保持平整；||立体包装物应清空内容物，清洁后压扁投放；||废玻璃制品应轻投轻放，有尖锐边角的应包裹后投放','指可资源化利用的物质，如废纸，废塑料，废金属，废包装物，废旧纺织物，废弃电器电子产品，废玻璃，废纸塑铝复合包装等。',NULL,'可回收物',2),(6360,'分类投放有害垃圾时，应注意轻放；|废灯管等易破损的有害垃圾应连带包装或包裹后投放；|废弃药品宜连带包装一并投放；|杀虫剂等压力罐装容器，应排空内容物后投放；|在公共场所产生有害垃圾且未发现对应收集容器时，应携带至有害垃圾投放点妥善投放。','指对人体健康或自然环境有直接或潜在危害的物质，如废电池（镉镍电池、氧化汞电池、铅蓄电池等），废灯管（日光灯管、节能灯等），废温度计，废血压计，废药品及其包装物，废油漆、溶剂及其包装物，废杀虫剂、消毒剂等。',NULL,'有害垃圾',2),(6361,'厨余垃圾应从产生时就与其他品种垃圾分开收集，投放前尽量沥干水分；|有包装物的厨余垃圾将包装物去除后分类投放，包装物应投放到对应的可回收物或其他垃圾收集容器；|盛放厨余垃圾的容器，如塑料袋等，在投放时应予以去除。','指日常生活中产生的易腐烂垃圾，如相关单位食堂、宾馆、饭店等产生的餐厨垃圾；居民区产生的厨余垃圾；农贸市场、农产品批发市场产生的蔬菜瓜果垃圾、腐肉、肉碎骨、蛋壳、畜禽产品内脏等。',NULL,'厨余垃圾',2),(6362,'其他垃圾应投入其他垃圾收集容器，并保持周边环境整洁。','即除可回收物、厨余垃圾和有害垃圾之外的生活垃圾，如受污染与无法再生的纸张、受污染或其他不可回收的玻璃、塑料袋与其他受污染的塑料制品、废旧衣物与其他纺织品、破旧陶瓷品、难以自然降解是肉食骨骼、妇女卫生用品、一次性餐具、烟头、灰土等。',NULL,'其他垃圾',2),(6363,'纸类应尽量叠放整齐，避免揉团，纸板也应拆开叠放；|||投放的牛奶利乐包等食品包装应折叠压扁；|||投放瓶罐类物品应尽可能将容器内产品用尽或倒净后投放；|||玻璃类物品应小心轻放，以免割伤破损，最好是袋装或者用容器装好后投放；|||织物类应打包整理后，定期投放到指定收集点；|||废弃的手机、电脑等废旧电子产品需经过专业拆解和处理后投放到指定收集点','可回收物是指经过加工可以成为生产原料或者经过整理可以利用的物品。',NULL,'可回收物',7),(6364,'废弃的荧光灯管投放时请打包固定，荧光灯管中含荧光粉和汞，需包装轻放丢弃；|过期药品及其包装物应投放到市食品药品监督管理局设置在药店或社区卫生中心的过期药品回收点。','有害垃圾是指对人体健康或自然环境造成直接或潜在危害的物质。',NULL,'有害垃圾',7),(6365,'易腐垃圾应投放到专用的易腐垃圾桶中；|易腐垃圾水分多，易腐烂变质，散发臭气，既影响小区环境，也容易在垃圾收运过程中出现污水滴漏问题，投放时要沥干水分，扎紧口袋。','易腐垃圾主要指餐厨垃圾。',NULL,'易腐垃圾',7),(6366,'用过的餐巾纸、尿片等，由于沾有各类污迹，无回收利用价值，宜作为其他垃圾投放；|儿童使用的轻质粘土、橡皮泥等属于其他垃圾；|破碎的陶瓷碗盆不再有循环利用的价值，属于其他垃圾；|报纸等如果被油污污染就不利于资源再利用，污损严重的纸张属于其他垃圾；|现在的铅笔不含铅，而是用石墨和粘土制造的，属于其他垃圾；|圆珠笔本身循环利用的价值不高，属于其他垃圾；|外卖餐盒大多是一次性的，塑料品质也不高，关键是被污杂后很难进行有效的资源化利用，将餐盒中的食物残余清理后投人其他垃圾箱。','其他垃圾是指除可回收物、有害垃圾以外的难以回收的生活废弃物。',NULL,'其他垃圾',7),(6367,'厨余垃圾应从产生时就与其他类别垃圾分开归类，去除食材食品的包装物，不得混入纸巾餐具、厨房用具等；|||餐厨垃圾中的废弃食用油脂，应单独存放、交付餐厨垃圾收集运输单位；|||难以生物降解的贝壳、大骨头、毛发等，应作为其他垃圾投放；||厨余垃圾应滤去水分后再投放','厨余垃圾，是指农贸市场、农产品批发市场和居民家庭日常生活中产生的废弃蔬菜瓜果、腐肉、肉碎骨、蛋壳、畜禽动物内脏、水产品废弃物等食物残余；\n餐厨垃圾，是指从事餐饮服务、集体供餐等活动的单位（含个体工商户)在生产经营过程中产生的食物残余和废弃食用油脂。',NULL,'厨余垃圾',16),(6368,'可回收物应尽量保持干燥干净，避免受到污染;|废纸应尽量保持平整，废纸箱应规整压平;|快递包装盒应去除胶带后投放;|立体包装物（瓶、罐、盒等）投放前，应清空内容物，尽量清洗干净、压扁;|废玻璃制品应轻投轻放，有尖锐边角的应包裹后投放;|尖锐的废金属制品应包裹后投放;|用于捐赠的旧衣物，清洗干净后，自行送到专门的捐赠点;|大块纸板、泡沫板等，不宜直接投入可回收物收集容器，应规整后置于投放点（收集容器旁）或预约上门收集;|废电器电子产品应尽量保持完整，不宜自行拆解;|大件垃圾不应随意堆放，应在指定的时间段投放到大件垃圾投放点，或通过电话、网络预约回收企业上门回收;|倡导按照材质属性对可回收物进行细分并投入可回收物智能回收箱或细分的可回收物收集容器。','生活中产生的未污染的适宜回收的可资源化利用的废弃物。',NULL,'可回收物',16),(6369,'有害垃圾投放时宜保持物品的完整性，并轻投轻放;|废荧光灯管、废含汞温度计等易破损的有害垃圾，应连带包装或包裹后投放；破损的废电池（如镉镍电池、氧化汞电池、铅蓄电池等）应采用透明塑料袋封装后再投放;|废油漆和废杀虫剂、清洁剂、空调清洗剂等均应与原容器一起密封投放;|废药品及其内包装应投放至有害垃圾收集容器或过期药品回收点。不接触或未沾染药品的纸盒等外包装可投放至可回收物收集容器;|在公共场所产生有害垃圾且未发现对应收集容器时，应将有害垃圾携带至设置有害垃圾收集容器的地点妥善投放。','对人体健康或者自然环境造成直接或者潜在危害的生活垃圾。',NULL,'有害垃圾',16),(6370,'其他垃圾或成分复杂难以分辨类别的生活垃圾，投入其他垃圾收集容器。','除厨余垃圾（餐厨垃圾）、可回收物、有害垃圾以外的生活垃圾。',NULL,'其他垃圾',16),(6371,'废纸类（含利乐包等食品包装）应折叠压扁打包，减少物料的体积；|投放瓶罐应尽可能将容器内产品用尽或倒尽，并清理干净后投放；|玻璃类物品应小心轻放、以免割伤破损，最好是袋装或者用容器装好后投放；|织物类应打包整齐，定期投放到指定收集点；|受污染纸类不属于可回收物，放入其他垃圾桶内。','适宜回收和资源化利用的生活垃圾。主要包括废纸、废玻璃、废金属等。',NULL,'可回收物',28),(6372,'易脆、易挥发有毒物质，如水银温度计、日光灯管、荧光灯管、节能灯等轻拿轻放，保证包装完整性；|有毒有害水溶剂，如油漆桶、杀毒剂等盖紧瓶盖，采取必要的密闭措施；|其它有毒有害物质，如废药品、胶片、相纸、硒鼓墨盒、充电电池。废电路板等包装好后投入有害垃圾桶；|日前产生的一次性电池已实现低汞和无汞化，宜作为其他垃圾进行投放；|LED灯投放至其他垃圾桶内。','含有有害物质，需要特殊安全处理的生活垃圾。包括废荧光灯管、废油漆桶、废水银温度计、过期药品、废充电电池等日常用品，这些垃圾需要特殊安全处理。',NULL,'有害垃圾',28),(6373,'厨余垃圾不同于餐厨垃圾。餐厨垃圾专指餐饮服务过程中产生的宜腐烂生活垃圾。其含水量、油分、盐分更高；|厨余垃圾要先沥干水分，放入专用的厨余垃圾袋中，并扎紧袋口投入厨余垃圾桶内；|厨余垃圾每天投放一次,避免厨余垃圾腐烂变质，产生臭气；|厨余垃圾严禁掺入有毒有害物品，避免在后期处理过程中造成不必要的麻烦。','厨余垃圾是指居民家庭日常生活产生的有机生活垃圾。包括剩菜剩饭、瓜皮果壳、废弃食品调料及茶渣落叶。',NULL,'厨余垃圾',28),(6374,'用过的餐巾纸、尿片等受污染的纸类投放前采用压缩处理减少体积；|家庭大扫除产生大量的灰土等无利用价值的垃圾在清运点收运作业时集中投放，避免占用其他垃圾桶容积；|大件垃圾及装修垃圾不得混入其他垃圾进行投放。','除厨余垃圾（餐厨垃圾）、可回收物、有害垃圾之外的其他生活垃圾。包括卫生纸、灰土陶瓷等难以回收以及暂无回收利用价值的废弃物。',NULL,'其他垃圾',28),(6375,'纸类应尽量叠放整齐，避免揉团，纸箱、纸板也应拆开叠放；||牛奶利乐包等食品包装盒应洗净后折叠压扁后投放；||瓶罐类物品应小心轻放，以避免割伤破损，最好是袋装或用容器包装好后投放；||破碎的请用包装物包好，防止划伤','指适宜回收和资源利用的垃圾，主要包括纸类、塑料、玻璃、金属、织物和瓶罐等。',NULL,'可回收物',22),(6376,'废弃的荧光灯管、灯泡投放时请打包固定(亦可利用新购荧光灯管、灯泡的包装)，以防止灯管、灯泡破损后有害的汞蒸挥发到环境中；|在日常生活中，使用的电池种类很多，目前生产的一次性电池已实现低汞或无汞化，宜作为其他垃圾投放。除一次性电池外的二次电池(俗称充电电池，包括镍镉、镍氢、锂电池与铅酸蓄电池)、纽扣电池，这些电池中均含有重金属，属于有害垃圾，要投放到有害垃圾桶中，个人不得随意丢弃；|过期药品由于过了最佳使用期限，药品化学成分会失效或变性，因此过期药品与包装物属于有害垃圾；|为了我们的生活环境更美好，请将有害垃圾投放到有害垃圾桶中，由我们收集后统进行无害化处理。','指含有害物质，需要特殊安全处理的垃圾，主要包括对人体健康或自然环境造成直接或潜在危害的电池、灯管和日用化学品等。',NULL,'有害垃圾',22),(6377,'厨余垃圾应投放到专用的厨余垃圾袋中；|厨余垃圾水分多,易腐烂变质，散发臭气，既影响小区环境，也容易在垃圾收运过程中出现污水滴漏问题，所以厨余垃圾投放时要沥干水分，扎紧袋口；|小区厨余垃圾桶应盖好盖，以免污染周边环境。','指居民在家庭生活中产生的垃圾，主要包括丢弃不用的菜叶、剩菜、剩饭、果皮、蛋壳、茶渣、骨头等。',NULL,'厨余垃圾',22),(6378,'用过的餐巾纸、尿片等由于沾有各类污渍，无回收利用价值，宜作为其他垃圾进行处理；|普通一次性电池(碱性电池)基本不含重金属，宜作为其他垃圾投放。','除去可回收垃圾、有害垃圾、厨余垃圾之外的所有垃圾的总称，主要包括受污染与无法再生的纸张、受污染或其他不可回收的玻璃、塑料袋与其他受污染的塑料制品、废旧衣物与其他纺织品、破旧陶瓷品、难以自然降解的肉食骨。',NULL,'其他垃圾',22),(6379,'分类投放可回收物时，应尽量保持清洁干燥，避免污染；|废纸应保持平整；|立体包装物应清空内容物，清洁后压扁投放；|废玻璃制品应轻投轻放，有尖锐边角的应包裹后投放。','指废纸张、废塑料、废玻璃制品、废金属、废织物等适宜回收、可循环利用的生活废弃物。',NULL,'可回收物',35),(6380,'分类投放有害垃圾时，应注意轻放；|废灯管等易破损的有害垃圾应连带包装或包裹后投放；|废弃药品宜连带包装一并投放；|杀虫剂等压力罐装容器，应排空内容物后投放；|在公共场所产生有害垃圾且未发现对应收集容器时，应携带至有害垃圾投放点妥善投放。','指废电池、废灯管、废药品、废油漆及其容器等对人体健康或者自然环境造成直接或者潜在危害的生活废弃物。',NULL,'有害垃圾',35),(6381,'厨余垃圾应从产生时就与其他品种垃圾分开收集，投放前尽量沥干水分|有包装物的厨余垃圾应将包装物去除后分类投放，包装物应投放到对应的可回收物或其他垃圾收集容器；|盛放厨余垃圾的容器，如塑料袋等，在投放时应予去除。','指家庭、餐馆、食堂、农贸市场、菜市场等产生的餐厨垃圾。',NULL,'厨余垃圾',35),(6382,'其他垃圾应投入其他垃圾收集容器，并保持周边环境整洁。','指除可回收物、有害垃圾、餐厨垃圾以外的其他生活废弃物。',NULL,'其他垃圾',35),(6383,'可回收物能卖拿去卖；|不能售卖、没有回收利用渠道的，可按其他垃圾投放；|玻璃瓶、塑料瓶、易拉罐等应清空内容物，清洗干净后投放；|易破损或有尖锐边角的可回收物，应包裹后投放；|快递包装物，根据材质，纸盒归入废纸类可回收物，塑料包装袋打结，可归入废塑料类可回收物；|整体性强、不能拆解的木质家具，应按大件垃圾投放；|煤气罐、灭火器虽是金属制品，但有残留气体或药物，应由厂家、销售店或委托专业公司回收，不可投放至可回收物收集容器内；|大件垃圾应预约再生资源回收企业、物业服务公司或生活垃圾分类收集单位回收，或投放至指定回收点；|电器电子产品应按照产品说明书或者产品销售、售后服务机构标注的回收信息预约回收或交给物业服务公司收集，或投放至指定回收点。','可回收物是指生活中产生的适宜回收和可循环再利用的物品。',NULL,'可回收物',30),(6384,'投放时要轻放，不要弄破有害垃圾的容器或包装物；|易碎或者含有液体的有害垃圾应连带包装或包裹投放，防止破损或渗漏；|杀虫剂等压力罐应轻投轻放，不能挤压。','有害垃圾是指生活中产生的对人体健康或者自然环境造成直接或潜在危害的物质。',NULL,'有害垃圾',30),(6385,'厨余垃圾沥干水分、去除包装物后，存放于家庭厨余垃圾容器；|在垃圾投放点投放时应去除垃圾袋，投放至厨余垃圾收集容器内，垃圾袋投放至其他垃圾收集容器内；|纸巾、牙签属于其他垃圾，应避免混到厨余垃圾中；|家庭废弃的土培绿色植物不归入厨余垃圾，应土、盆、植物分离，培养土可重复利用或用于小区绿化，植物作为其他垃圾投放，盆按类别投放；|吃剩的快餐饭菜应沥干水后投放至厨余垃圾收集容器内，餐盒或包装物应作为其他垃圾投放；|鼓励居民将餐盒清洗干净后投放至可回收物收集容器中；|死禽畜及宠物、年花年桔的收集处理另有规定，实行专项收集处理。','厨余垃圾是指生活中产生的易腐烂、易变质发臭的废弃物。',NULL,'厨余垃圾',30),(6386,'对于不能准确判断类别的垃圾，可将其视为其他垃圾，投放至其他垃圾收集容器内；|陶瓷马桶、陶瓷浴缸、瓷砖，按家庭装修垃圾的投放方法进行投放；|家庭装修垃圾和生活垃圾应分开收集，装修垃圾装袋后投放到指定场所。','其他垃圾是指居民家庭生活中产生的除餐厨垃圾、有害垃圾、可回收物之外的生活垃圾。',NULL,'其他垃圾',30),(6387,'投放餐厨垃圾时，要沥干水分，扎紧袋口；||应将餐厨垃圾内食材包装物去除，不得混入塑料袋、湿纸巾等厨房用品；||应将大棒骨等不易腐烂的餐厨垃圾投入其他垃','主要品种：相关单位食堂、宾馆、饭店等产生的餐厨垃圾，农贸市场、农产品批发市场产生的蔬菜瓜果垃圾、腐肉、肉碎骨、蛋壳、畜禽产品内脏等。',NULL,'餐厨垃圾',36),(6388,'投放可回收物时，应尽量保持清洁干燥，避免污染；|废纸应保持平整；|立体包装物应清空内容物，压扁投放；|废玻璃制品应轻投轻放，有尖锐边角的应包裹后投放；','主要品种：废纸、废塑料、废金属、废包装物、废旧纺织物、废弃电器电子产品、废玻璃、废纸塑铝复合包装等。',NULL,'可回收物',36),(6389,'投放有害垃圾时，应轻投轻放；|废灯管等易碎有害垃圾应连包装或包裹后投放；|废弃药品宜连带包装一并投放；杀虫剂等灌装压力容器，应排空内容物后投放。','主要品种：废电池（镉镍电池、氧化汞电池、铅蓄电池等），废荧光灯管（日光灯管、节能灯等），废温度计，废血压计，废药品及其包装物，废油漆、溶剂及其包装物，废杀虫剂、消毒剂及其包装物，废胶片及废相纸等。',NULL,'有害垃圾',36),(6390,'其他垃圾投放至其他垃圾桶内，保持周围干净整洁；|无汞干电池投入其他垃圾。','主要品种：受污染与无法再生的纸张（纸杯、照片、复写纸、压敏纸、收据用纸、明信片、相册、卫生纸、尿片等）；受污染或其他不可回收的玻璃、塑料袋与其他受污染的塑料制品等。',NULL,'其他垃圾',36),(6391,'厨余垃圾应当投放至绿色餐厨垃圾收集容器；|||投放时应尽量沥干水分，纯液体（如牛奶等），请直接导入下水口；|||大块骨头、椰子壳等不易生化降解，请作为其他垃圾投放','指相关食堂、宾馆、饭店等产生的餐饮垃圾及居民家庭产生的废弃蔬菜瓜果、废弃肉类鱼虾、剩菜剩饭厨余垃圾。',NULL,'厨余垃圾',34),(6392,'可回收物可交售给再生资源回收站点、回收经营者，或者投放至蓝色可回收物收集容器、收集点；|居民投放时请不要把已被污染或潮湿或污渍无法清除的物品投入可回收物容器；|在投入立体包装物（如瓶罐）前请倒空内容物并简单洗晾干。','指生活垃圾中未经污染、适宜回收循环利用的废弃物。',NULL,'可回收物',34),(6393,'有害垃圾应当交给有害垃圾回收站点，或者投放至红色有害垃圾收集容器；|有害垃圾投放时应妥善包裹、小心轻放。','指生活垃圾中对人体健康或自然环境造成直接或潜在危害的物质。',NULL,'有害垃圾',34),(6394,'其他垃圾应当投放至灰色其他垃圾收集容器；|有害餐厨可回收，分完以外是其他。','指除可回收物、有害垃圾、餐厨垃圾以外的其他生活垃圾。',NULL,'其他垃圾',34),(6395,'可回收物应投入可回收物垃圾收集容器，并保持周边环境整洁','适宜回收循环利用和资源化利用的废弃物。',NULL,'可回收物',39),(6396,'有害垃圾应投入有害垃圾收集容器，并保持周边环境整洁。','含有害物质，需要特殊安全处理的垃圾',NULL,'有害垃圾',39),(6397,'餐厨垃圾应投入餐厨垃圾收集容器，避免混入废餐具、塑料、饮料瓶罐、废纸等不利于后续处理的杂物。','居民在家庭饮食生活、食品加工、饮食服务、单位供餐等活动中产生的易腐有机物。',NULL,'餐厨垃圾',39),(6398,'其他垃圾应投入其他垃圾收集容器，并保持周边环境整洁。','除去可回收垃圾、有害垃圾、餐厨垃圾之外的所有垃圾。',NULL,'其他垃圾',39),(6399,'分类投放可回收物时，应尽量保持清洁干燥，避免污染；|其中：废纸应保持平整；|立体包装物应清空内容物，清洁后压扁投放；||废玻璃制品应轻投轻放，有尖锐边角的应包裹后投放。','未污染的可回收物和资源利用的物资，主要包括：报纸、杂志、书本、纸板箱、金属制品、玻璃制品、塑料瓶等。',NULL,'可回收物',40),(6400,'分类投放有害垃圾时，应注意轻放。其中：废灯管等易破损的有害垃圾应连带包装或包裹后投放；|废弃药品宜连带包装一并投放；|杀虫剂等压力罐装容器，应排空内容物后投放；|在公共场所产生有害垃圾且未发现对应收集容器时，应携带至有害垃圾投放点妥善投放。','指对人体健康或者自然环境造成直接或者潜在危害的生活垃圾。包括：废电池、废灯管、废药品、废油漆及其容器等。',NULL,'有害垃圾',40),(6401,'餐厨垃圾应从产生时就与其他品种垃圾分开收集，投放前尽量沥干水分，其中：有包装物的餐厨垃圾应将包装物去除后分类投放；|包装物应投放到对应的可回收物或干垃圾收集容器；|盛放餐厨垃圾的容器，如塑料袋等，在投放时应予去除。','即日常家庭生活中食品加工产生的垃圾，主要包括：剩菜剩饭和西餐糕点等食物残余、菜梗菜叶、动物骨骼内脏、菜叶渣等植物的残枝落叶、废弃食用油等。',NULL,'餐厨垃圾',40),(6402,'其他垃圾应投入其他垃圾收集容器，并保持周边环境整洁。','除去可回收物、有害垃圾、餐厨垃圾以外的所有生活废弃物。主要包括：污损纸巾、食品包装袋、卫生间垃圾等。',NULL,'其他垃圾',40),(6403,'轻投轻放；||清洁干燥，避免污染；||废纸尽量平整；||立体包装物清空内容物，清洁后压扁投放','城市生活垃圾中未污染适宜回收和再生利用的生活废弃物。',NULL,'可回收物',38),(6404,'轻投轻放；|油漆桶、杀虫剂等如有残留请密闭后投放；|荧光灯、节能灯等易破损物品请连带包装或包裹后轻放；|废药品请连带包装一起投放；','城乡生活垃圾中对人体健康或自然环境造成直接或潜在危害的有毒有害物质，需要特殊安全处理的城乡生活垃圾。',NULL,'有害垃圾',38),(6405,'纯流质的食物垃圾，如牛奶等，应直接倒进下水口；|有包装物的厨余垃圾应将包装物去除后分类投放，包装物投放到对应的可回收物或其他垃圾容器；|投放厨余垃圾时，鼓励将包装物（如塑料袋）去除。','城乡生活产生的不宜久放，容易腐坏的生活废弃物。',NULL,'厨余垃圾',38),(6406,'尽量沥干水份；|难以辨识类别的生活垃垃圾投入其他垃圾容器内。','除可回收物、易腐垃圾和有害垃圾之外，未能单独收集的各类城乡生活垃圾。',NULL,'其他垃圾',38),(6407,'纸张类：硬纸折好压平/报纸杂志等用绳索捆牢收集；|塑料类：塑料瓶瓶盖要拧开/瓶内残留物用水洗净，瓶身压扁，塑料桶/塑料盒等洗净晒干；|玻璃类：玻璃瓶要去掉瓶盖/撕掉瓶身标签，瓶内残留物用水洗净，破玻璃片用纸张包住并用胶纸缠好，玻璃应装入透明塑料袋；|织物类：废旧纺织品洗净，折好压平后用绳索捆牢；|金属类：易拉罐/罐头盒等踩扁压实，金属尖利器物用硬纸包裹捆绑，软管类进行简单剪裁。','指未污染的适宜回收和资源利用的生活垃圾。',NULL,'可回收物',15),(6408,'废电池：废电池保持完整，防止有害物质外漏，采用塑料袋封装，防止风吹/雨淋/暴晒；|废灯管：废灯管保持完整/清洁/干燥，用硬纸包好，防止灯管破碎；|过期药品：软膏类药品将药膏从容器中挤出，收集在信封内封好，玻璃容器类药品撕掉完整标签，分门别类装入不透明的塑料袋内，针剂/水剂类注射药品不开启，连同其完整外包装一起，封入密闭的纸筒内，针头另外放入密闭纸筒内，喷雾剂类药品在户外空气流通较好的地方，避免接触明火的条件下彻底排空，其他类药品撕掉药品标签及相关个人标签，用不透明塑料袋装好；|杀虫剂罐：杀虫剂要用完或排空，在通风良好避免明火的地方在罐身上打孔后投放。','指对人体健康或者自然环境造成直接或者潜在危害的生活垃圾。',NULL,'有害垃圾',15),(6409,'易腐滤水袋装后投放到指定收集容器，避免混入包装袋/餐巾纸/保鲜膜等物品，投放时袋口要扎紧。','指餐饮经营者/单位食堂等生产过程中产生的餐厨废弃物，居民家庭生活中产生的厨余垃圾和集贸市场产生的有机垃圾等。',NULL,'易腐垃圾',15),(6410,'将其他垃圾单独区分，避免将可回收物/有害垃圾混入，袋装后投放到指定收集容器内，投放时袋口要扎紧。','指除可回收物/有害垃圾和易腐垃圾之外的其他生活垃圾。',NULL,'其他垃圾',15),(6411,'将有害垃圾单独投放至“有害垃圾收集容器”内或固定回收点；|投放时不应弄破有害垃圾的容器或包装物；|灯管、温度计等易碎的有害垃圾应用纸或布包裹后投放','生活垃圾中对人体健康或者自然环境造成直接或潜在危害的物质',NULL,'有害垃圾',27),(6412,'宜用可降解的垃圾袋密闭袋装，投放前去除食品包装及餐具制品，并沥干水分，投放时避免二次污染','生活垃圾中以有机质为主要成分，具有含水率高、易腐烂发酵发臭等特点的物质',NULL,'厨余垃圾',27),(6413,'其他垃圾应投入其他垃圾收集容器，并保持周边环境整洁','生活垃圾中除可回收物、有害垃圾、厨余垃圾以外的其它生活废弃物',NULL,'其他垃圾',27),(6414,'废纸类投放前，应去除塑料封面（套）、钉针等，并铺平叠好，加以捆绑；|||瓶罐等容器应倒空内装物，饮料软包装应抽出吸管并压平；|||纸、塑、金属等混杂的物品应尽可能按属性进行拆解','生活垃圾中未经污染且适宜回收循环使用和资源化利用的物质',NULL,'可回收物',27),(6415,'过期药品由于过了最佳使用期限，药品化学物质会失效或者变性，因此过期药品与包装物属于有害垃圾；||||废弃的荧光灯管灯泡投放时请打包固定，亦可使用新购荧光灯管、灯泡包装物进行包装，以防止灯管、灯泡破损以至有害的汞蒸气挥发到环境中；||||在日常生活中，使用的电池种类很多，目前生产的一次性电池已经实现低汞和无汞化，宜作为其他垃圾投放；||||除一次性电池外的二次电池（俗称充电电池；|||包括镍镉、镍氢、锂电池与铅酸蓄电池）、纽扣电池；||这些电池中均含有重金属；|属于有害垃圾，要投放到有害垃圾桶中，个人不得随意丢弃。','指废电池、废灯管、废药品、废油漆及其容器等对人体健康或者自然环境造成直接或者潜在危害的生活废弃物。',NULL,'有害垃圾',9),(6416,'沿街餐饮商铺：厨房设置餐厨垃圾和其他垃圾收集容器，餐厨垃圾收集容器容量按餐厨垃圾产生量设定，餐厨垃圾要与具有收运资质的企业签约，定时交由企业集中收运；||||集中食堂：分类垃圾桶设置容量和数量，要根据食堂面积大小和平均人流量配备；|||分类的垃圾按照分类标识进行投放，有条件的单位在垃圾桶上方配置指引架，指导就餐人员分类投放；||||注：猪牛羊大骨、大鱼骨及海鲜贝壳宜作为其他垃圾进行投放','餐饮垃圾和厨余垃圾的总称。其中，餐饮垃圾是相关企业和公共机构在食品加工、饮食服务、单位供餐等活动中，产生的食物残渣、食品加工废料和废弃食用油脂。厨余垃圾是指居民家庭日常生活过程中产生的菜帮、菜叶、瓜果屁等。',NULL,'厨余垃圾',9),(6417,'纸类应尽量叠放整齐，避免揉团，纸板也应拆开叠放；|投放的牛奶利乐包等食品包装盒应折叠压扁；|投放瓶罐类物品应尽可能将容器内产品用尽或倒尽，并清理干净后投放；|玻璃类物品应小心轻放，以免割伤破损，最好是袋装或者用容器装好后投放；|织物类应打包整齐后，定期投放到指定收集点。','指废纸张、废塑料、废玻璃制品、废金属、废织物等适宜回收、可循环利用的生活废弃物。',NULL,'可回收物',9),(6418,'其他垃圾应投入其他垃圾收集容器，并保持周边环境整洁。','由个人在单位和家庭日常生活中产生，除有害垃圾、可回收物、餐厨垃圾之外的生活废弃物。',NULL,'其他垃圾',9),(6419,'单位或个人应当自厨余垃圾（易腐垃圾）产生时就与其他垃圾（可燃垃圾）分开投放、分开收集；||投放前应尽量沥干水分；|纯流质的食物垃圾，如牛奶、饮料等，应直接倒进下水口；|有外包装的如塑料袋、餐盒等，应去除外包装后投放，逐步实现厨余垃圾（易腐垃圾）“无玻璃陶瓷、无金属杂物、无塑料橡胶”；|公共场所产生厨余垃圾（易腐垃圾）且未发现对应收集容器时，应携带至厨余垃圾（易腐垃圾）投放点妥善投放','是指有机易腐垃圾，主要包括：食品销售、餐饮服务、单位食堂、居民家庭产生的食材废料、剩饭剩菜、过期食品、花卉绿植（家庭少量）、中药药渣等。',NULL,'厨余垃圾',25),(6420,'可回收垃圾投放时，应尽量保持清洁干燥，避免污染；||废纸类投放前，应去除塑料封面（套）、钉针等，并铺平叠好；||瓶罐、复合纸质包装等应倒空内容物，抽出吸管，清洁后压扁投放；|易破损或有尖锐边角的应包裹后投放','是指适宜回收和可循环再利用的物品，主要包括：废纸，废塑料，废金属，废玻璃、废旧包装物，废旧纺织物，废弃电器电子产品等。',NULL,'可回收物',25),(6421,'有害垃圾投放时，应注意轻放。废旧灯管等易破损的有害垃圾应连带包装或包裹后投放；|废弃药品应连带包装一并投放；|杀虫剂等压力罐装容器应排空内容物后投放。公共场所产生有害垃圾且未发现对应收集容器时，应携带至有害垃圾投放点妥善投放。','是指对人体健康或者自然环境造成直接或者潜在危害的物质，主要包括：废电池（镉镍电池、氧化汞电池、铅蓄电池等），废灯管（日光灯管、节能灯等），含汞废弃物，废药品及其包装物，废油漆及其包装物，胶片及废相纸等。',NULL,'有害垃圾',25),(6422,'除有害垃圾、餐厨垃圾（易腐垃圾）、可回收垃圾以外的其他生活垃圾，以及成分复杂难以分辨类别的生活垃圾，投入其他垃圾（可燃垃圾）收集容器，并保持周边环境整洁。','是指除有害垃圾、餐厨垃圾（易腐垃圾）、可回收垃圾以外的生活垃圾。',NULL,'其他垃圾',25),(6423,'分类投放可回收物时，应尽量保持清洁干燥，避免污染；||废纸应保持平整；||立体包装物应清空内容物，清洁后压扁投放；||废玻璃制品应轻投轻放，有尖锐边角的应包裹后投放','可回收物指生活垃圾中未污染的适宜回收循环使用和资源利用的废弃物品。主要包括：废纸、废塑料、废金属，废包装物，废旧纺织物，废弃电器电子产品，废玻璃，废纸塑铝复合包装及大件垃圾等。',NULL,'可回收物',24),(6424,'分类投放有害垃圾时，应注意轻放；|废灯管等易破损的有害垃圾应连带包装或包裹后投放；|废弃药品宜连带包装一并投放；|杀虫剂等压力罐装容器，应排空内容物后投放；|在公共场所产生有害垃圾且未发现对应收集容器时，应携带至有害垃圾投放点妥善投放。','有害垃圾指对人体健康或自然环境造成直接或潜在危害的废弃物。主要包括：废电池（镉镍电池、氧化汞电池、铅蓄电池等），废荧光灯管（日光灯管、节能灯等），废温度计，废血压计，废药品及其包装物，废油漆、溶剂及其包装物。',NULL,'有害垃圾',24),(6425,'厨余垃圾应从产生时就与其他品种垃圾分开收集，投放前尽量沥干水分；|有包装物的厨余垃圾应将包装物去除后分类投放，包装物应投放到对应的可回收物或其他垃圾收集容器；|盛放厨余垃圾的容器，如塑料袋等，在投放时应予去除。','指食材废料、剩菜剩饭、过期食品、瓜皮果核、花卉绿植、中药药渣等易腐的生物质生活废弃物。',NULL,'厨余垃圾',24),(6426,'其他垃圾应投入其他垃圾收集容器，避免易腐垃圾和可回收物的混入，并保持周边环境整洁。','指除可回收物、有害垃圾、易腐垃圾以外的其它生活废弃物。',NULL,'其他垃圾',24),(6427,'轻投轻放；||清洁干燥，避免污染；||废纸尽量平整；||立体包装物请清空内容物，清洁后压扁投放；||有尖锐边角的，应包裹投放；||体积大、整体性强或者需要拆分再处理的家具、家电等大件垃圾，应当预约再生资源回收经营企业、生活垃圾分类收集单位回收，或者投放至指定投放点','指适宜回收和资源利用的垃圾。',NULL,'可回收物',33),(6428,'灯管、水银产品等易碎或者含有液体的有害垃圾在采取防止破损或者渗漏的措施后投放。','指含有害物质，需要特殊安全处理的垃圾。',NULL,'有害垃圾',33),(6429,'厨余垃圾沥干水分后投放。','指含有水分、易发酵腐烂、散发臭气的生活废弃物。',NULL,'厨余垃圾',33),(6430,'其他垃圾或成分复杂难以分辨类别的生活垃圾，投入其他垃圾收集容器。','除去可回收垃圾、有害垃圾、厨余垃圾之外的所有垃圾。',NULL,'其他垃圾',33),(6431,'玻璃容器应去掉瓶盖标签，清除残留物并用水洗净晾干后再投放；||易拉罐应踩扁压实，金属尖利器物应用硬纸包裹捆绑；||塑料瓶、塑料桶、塑料盒等应清除残留物并用水洗净，晾干、压扁后再投放；||废纸应折好压平并用绳索捆牢，回收时应避免受到污染；||废弃织物应捆牢后投放至废弃衣物回收箱；||能正常使用或维修后能再用的电器电子产品，应保持产品完整，优先考虑送给有需要的人或维修后继续使用，已损坏的电器电子产品，勿自行拆解，应投放至可回收物收集容器','指适宜回收和资源利用的废弃物，包括废弃的玻璃、金属、塑料、纸类、织物、家具、电器电子产品和年花年桔等。',NULL,'可回收物',31),(6432,'废电池应保持完好，尽量将残余电量用完再投放至废电池专用收集容器，防止暴晒雨淋；||||破损的电池应用透明塑料袋封装后再投放至废电池专用收集容器；||||废灯管应保持完整、清洁、干燥，防止破损，放置到废灯管专用收集容器；||||弃置药品及药具应尽量保持原包装，连同外包装一并投放至药品监督管理部门指定的收集容器','指对人体健康或者自然环境造成直接或者潜在危害且应当专门处理的废弃物，包括废电池、废灯管、废弃药品药具等。',NULL,'有害垃圾',31),(6433,'厨余垃圾应沥干水分，用袋装的应拆袋投放后把塑料袋单独投放到其他垃圾收集容器','指容易腐烂的食物残渣、瓜皮果核等生物质废弃物，可分为餐厨垃圾、家庭厨余垃圾、果蔬垃圾等。',NULL,'厨余垃圾',31),(6434,'碎玻璃应先用纸包裹再用胶带缠好，投放至其他垃圾收集容器；||一次性纸碟、墙纸、复写纸和被污染的纸巾、厕纸等应投放至其他垃圾收集容器；||污损严重的衣物、破袜子、旧内衣裤、拖布等应投放至其他垃圾收集容器；||破碎的灯管应用纸张包裹并用胶带缠好，投放至其他垃圾收集容器；||包装不完整、零星散装药品应用纸张包裹封装后投放至其他垃圾收集容器','指除可回收物、厨余垃圾、有害垃圾之外的其他生活垃圾。',NULL,'其他垃圾',31),(6435,'轻投轻放；||清洁干燥避免污染；||纸类尽量平整，避免揉团，立体包装物请清空内容物，清洁后压扁投放；||投放瓶罐类物品应尽可能将容器类产品用尽或倒尽，清理干净后投放；||玻璃类物品应小心轻放，以免割伤破损，最好袋装或者用容器装好后投放；||有尖锐边角的，包裹后投放','适宜回收循环利用和资源化利用类的废弃物。',NULL,'可回收物',5),(6436,'轻投轻放；|油漆桶、杀虫剂等如有残留请密闭后投放；|荧光灯、节能灯等易破损物品请连带包装或包裹后轻放；|废药品请连带包装一起投放。','对人体健康或自然环境造成直接或者潜在危害的废弃物。',NULL,'有害垃圾',5),(6437,'纯流质的食物垃圾，如牛奶等，应直接倒进下水口；|有包装物的厨余垃圾应将包装物去除后分类投放，包装物请投放到对应的可回收物或其他垃圾容器；|投放厨余垃圾时，鼓励将包装物（如塑料袋）去除。','容易腐烂的生物质废弃物。',NULL,'厨余垃圾',5),(6438,'尽量沥干水分；|难以辨识类别的生活垃圾投入其他垃圾容器类。','除有害垃圾、易腐垃圾、可回收物以外的其他废弃物。',NULL,'其他垃圾',5),(6439,'轻投轻放；|||清洁干燥，避免污染；|||废纸尽量平整；|||立体包装物请清空内容物，清洁后压扁投放；|||有尖锐边角的，应包裹后投放','指生活垃圾中具有资源回收利用价值的废弃物。',NULL,'可回收物',19),(6440,'纯流质的食物垃圾，如牛奶等，应直接倒进下水口；||有包装物的湿垃圾应将包装物去除后分类投放，包装物请投放到对应的可回收物或其他垃圾收集器','指居民日常家庭生活和农贸市场、农产品批发市场产生的有机易腐垃圾。',NULL,'厨余垃圾',19),(6441,'轻投轻放；|如易挥发液体，请密封后投放；|易破碎的请连带包装或包裹后轻放。','指对人体健康或自然环境造成直接或潜在危害的物质。',NULL,'有害垃圾',19),(6442,'请尽量沥干水分；|成分复杂难以分辨类别的生活垃圾，可投入其他垃圾收集容器。','指除可回收物、厨余垃圾、有害垃圾和大件垃圾以外的垃圾。',NULL,'其他垃圾',19),(6443,'投放至各社区、居民小区、单位设立的大件垃圾投放点。','指日常生活中产生的体积较大、整体性强、需要拆分后再处理或利用的废旧家具、家用电器等。',NULL,'大件垃圾',19),(6444,'各类纸应折好压平，并用绳索捆牢，回收时应避免受到污染；|易拉罐等应踩扁压实并撕掉瓶身标签，瓶内残留物应用水洗净，并尽可能保持完好，小心投放；|废弃织物应捆牢，用于捐赠的废弃织物，应清洗干净；|各类废弃电子产品，投放至可回收物垃圾桶；|破损电子产品应用透明袋封装后，投置可回收物垃圾桶。','适宜回收和可循环利用的生活垃圾，包括废纸、废塑料、废玻璃、废金属、废旧纺织物、废旧家具、废旧电器电子产品等。',NULL,'可回收物',14),(6445,'各类废电池应保持完好，投放至有害垃圾收集箱；|破损电池应用透明袋封装后，投放至有害垃圾收集箱；|各类废灯管应保持完整、清洁、干燥，防止破损，投放至有害垃圾收集箱；|破碎的灯管应用纸张包裹并用胶带缠好，投放到其他垃圾桶中；|废杀虫剂、清洁剂、空调清洗剂、空气清新剂等应在通风良好、确保安全的情况下彻底排空再投放；|废油漆、废弃化妆品等应做好密封投放至有害垃圾收集箱；|各类废弃药品、药具应尽量保持原药品包装；|包装不完整，零星散装药品应用纸张包裹。','对人体健康或者自然环境造成直接或者潜在危害的、应当专门处置的生活垃圾。包括废充电电池、废扣式电池、废荧光灯管、废药品、废油漆及其容器、废杀虫剂和消毒剂及其包装物等。',NULL,'有害垃圾',14),(6446,'厨余垃圾须沥干汤水，去袋投放，请勿将牙签、纸巾、塑料袋等杂物混入其中。','是指易腐的生物质生活垃圾，包括家庭产生的食材废料、剩菜剩饭、过期食品、瓜皮果壳、花卉绿植废弃物、中药药渣等厨余垃圾，农副产品集贸市场产生的有机垃圾。',NULL,'厨余垃圾',14),(6447,'其他垃圾应袋装投放，避免混入可回收物、有害垃圾和厨余垃圾。','除可回收物、有害垃圾、厨余垃圾之外的其他生活垃圾。',NULL,'其他垃圾',14),(6448,'分类投放可回收物时，应尽量保持清洁干燥，避免污染；||废纸应保持平整；|立体包装物应清空内容物，清洁后压扁投放；||废玻璃制品应轻投轻放，有尖锐边角的应包裹后投放','是指废弃的纸张、塑料、金属、纺织物，电器电子产品，玻璃，包装物等适宜回收和资源可循环利用的生活废弃物。',NULL,'可回收物',44),(6449,'分类投放有害垃圾时，应注意轻放；|废灯管等易破损的有害垃圾应连带包装或包裹后投放；|废弃药品宜连带包装一并投放；|杀虫剂等压力罐装容器，应排空内容物后投放；在公共场所产生有害垃圾且未发现对应收集容器时，应携带至有害垃圾投放点妥善投放。','是指废弃的电池(镉镍电池、氧化汞电池、铅蓄电池等)，荧光灯管(日光灯管、节能灯等，温度计，血压计，药品、油漆、溶剂及其包装物，杀虫剂、消毒剂、胶片、相纸以及农药包装等对人体健康或者自然环境造成直接或者',NULL,'有害垃圾',44),(6450,'厨余垃圾应从产生时就与其他品种垃圾分开收集，投放前尽量沥干水分；|有包装物的厨余垃圾应将包装物去除后分类投放，包装物应投放到对应的可回收物或其他垃圾收集容器；|盛放厨余垃圾的容器，如塑料袋等，在投放时应予破袋去除。','是指废弃的剩菜、剩饭、瓜果皮核、腐肉、骨头、蛋壳、畜禽产品内脏、花卉绿植、中药药渣等在日常生活中产生的易腐性垃圾。',NULL,'厨余垃圾',44),(6451,'凡成分复杂难以分辨类别的生活垃圾，投入其他垃圾收集容器，并保持周边环境整洁。','是指除有害垃圾、厨余垃圾、可回收物以外的生活垃圾。',NULL,'其他垃圾',44),(6452,'纸类应尽量叠放整齐，避免揉团，纸板也应拆开叠放；|投放的牛奶利乐包等食品包装盒应折叠压扁；|投放瓶罐类物品应尽可能将容器内产品用尽或倒尽，并清理干净后投放；|玻璃类物品应小心轻放，以免割伤破损，最好是袋装或者用容器装好后投放；|织物类应打包整齐后，定期投放到指定收集点。','可回收物是指适宜回收和资源利用的物品。',NULL,'可回收物',41),(6453,'废弃的荧光灯管灯泡投放时请打包固定，亦可使用新购荧光灯管灯泡包装物进行包装，以防止灯管灯泡破损以致有害的汞蒸气挥发到环境中；|在日常生活中，使用的电池种类很多，目前生产的一次性电池已实现低汞和无汞化，宜作为其他垃圾投放；除一次性电池外的二次电池（俗称充电电池）、纽扣电池，这些电池中均含有重金属，属于有害垃圾，要投放到有害垃圾桶中，个人不得随意丢弃；|过期药品由于过了最佳使用期限，药品化学物质会失效或者变性，因此过期药品与包装物属于有害垃圾；|为了我们生活的环境更美好，请将有害垃圾投放到有害垃圾桶中，由我们收集后统一进行无害化处理。','有害垃圾是指对人体健康或者自然环境造成直接或者潜在危险的生活垃圾。',NULL,'有害垃圾',41),(6454,'厨余垃圾应投放到专用的厨余垃圾袋中；|厨余垃圾水分多，易腐烂变质，散发臭气，既影响小区环境，也容易在垃圾收运过程中出现污水滴漏等问题，所以厨余垃圾投放时要沥干水分，扎紧口袋；|小区厨余垃圾桶应加盖密闭，以免污染周围环境。','厨余垃圾是指家庭废弃的有机易腐生活垃圾。',NULL,'厨余垃圾',41),(6455,'用过的餐巾纸、尿片等由于沾有各类污迹，无回收利用价值，宜作为其他垃圾进行处理；|普通一次性电池（碱性电池）基本不含重金属，宜作为其他垃圾投放。','其他垃圾是指除前三项以外的生活垃圾。',NULL,'其他垃圾',41),(6456,'轻投轻放；||清洁干燥避免污染；||纸类尽量平整，避免揉团，立体包装物请清空内容物，清洁后压扁投放；||投放瓶罐类物品应尽可能将容器类产品用尽或倒尽，清理干净后投放；||玻璃类物品应小心轻放，以免割伤破损，最好袋装或者用容器装好后投放；||有尖锐边角的，包裹后投放','表示适宜回收利用的生活垃圾，包括纸类、塑料、金属、玻璃、织物等。',NULL,'可回收物',37),(6457,'轻投轻放；|油漆桶、杀虫剂等如有残留请密闭后投放；|荧光灯、节能灯等易破损物品请连带包装或包裹后轻放；|废药品请连带包装一起投放。','表示《国家危险废物名录》中的家庭源危险废弃物，包括灯管、家用化学品和电池等。',NULL,'有害垃圾',37),(6458,'纯流质的食物垃圾，如牛奶等，应直接倒进下水口；|有包装物的厨余垃圾应将包装物去除后分类投放，包装物请投放到对应的可回收物或其他垃圾容器；|投放厨余垃圾时，鼓励将包装物（如塑料袋）去除。','表示易腐烂的、含有有机质的生活垃圾，包括家庭厨余垃圾、餐厨垃圾和其他厨余垃圾等。',NULL,'厨余垃圾',37),(6459,'尽量沥干水分；|难以辨识类别的生活垃圾投入其他垃圾收集器。','表示除可回收物、有害垃圾、厨余垃圾外的生活垃圾。',NULL,'其他垃圾',37),(6460,'分类投放可回收物时，应尽量保持清洁干燥，避免污染；||废纸应保持平整；||立体包装物应清空内容物，清洁后压扁投放；||废玻璃制品应轻投轻放，有尖锐边角的应包裹后投放','指适宜回收和资源利用的生活垃圾，包括：废弃的纸张、塑料、金属、包装物、纺织衣物、电器电子产品、玻璃等。',NULL,'可回收物',6),(6461,'其他垃圾应投入干垃圾收集容器，并保持周边环境整洁','指除其它三项之外的其他生活垃圾，包括：不可降解的一次性餐具、厕所废纸、纸巾餐纸、烟蒂、清扫渣土等。',NULL,'其他垃圾',6),(6462,'厨余垃圾应从产生时就与其他品种垃圾分开收集，投放前尽量沥干水分；|有包装物的厨余垃圾应将包装物去除后分类投放，包装物应投放到对应的可回收物或干垃圾收集容器；|盛放厨余垃圾的容器，如塑料袋等，在投放时应予去除','指易腐性垃圾，包括食材废料、剩菜剩饭、变质食品、瓜皮果核、中药药渣、碎骨蛋壳、畜禽内脏等。（变质食品已含腐肉）',NULL,'厨余垃圾',6),(6463,'分类投放有害垃圾时，应注意轻放；|||废灯管等易破损的有害垃圾应连带包装或包裹后投放；|||废弃药品宜连带包装一并投放；|||杀虫剂等压力罐装容器，应排空内容物后投放；|||在公共场所产生有害垃圾且未发现对应收集容器时，应携带至有害垃圾投放点妥善投放','指对人体健康或者自然环境造成直接或者潜在危害的生活垃圾，包括：废弃的电池（镉镍电池、氧化汞电池、铅蓄电池等），废弃的荧光灯管（日光灯管、节能灯等），废弃的水银温度计、血压计，废弃的药品及其包装物。',NULL,'有害垃圾',6),(6464,'投放可回收物时，应尽量保持清洁干燥，避免污染；||废纸应保持平整；||立体包装物应清空内容物，清洁后压扁投放；||废玻璃制品和废旧电器电子产品应轻投轻放，有尖锐边角的应包裹后投放','指适宜回收和资源利用的垃圾。主要包括：包括纸类、塑料、玻璃、金属、织物和瓶罐等。',NULL,'可回收物',23),(6465,'投放有害垃圾时，应注意轻放；|废灯管、水银温度计等易破损的有害垃圾应连带包装或包裹后投放；|废弃药品宜连带包装一并投放；|杀虫剂等压力罐装容器，应排空内容物后投放。','指含有害物质，需要特殊安全处理的垃圾。主要包括：包括对人体健康或自然环境造成直接或潜在危害的电池、灯管和日用化学品等。',NULL,'有害垃圾',23),(6466,'厨余垃圾投放前尽量沥干水分；|有包装物的厨余垃圾应将包装物去除后分类投放，包装物应投放到对应的可回收物或其他垃圾收集容器；|盛放厨余垃圾的容器，如塑料袋等，在投放时应予去除。','指居民在家庭生活中产生的垃圾，主要包括：丢弃不用的菜叶、剩菜、剩饭、果皮、蛋壳、茶渣、骨头等。',NULL,'厨余垃圾',23),(6467,'其他垃圾应投入其他垃圾收集容器，并保持周边环境整洁。','除去可回收物、有害垃圾、厨余垃圾之外的所有垃圾。主要包括：受污染与无法再生的纸张、受污染或其他不可回收的玻璃、塑料袋与其他受污染的塑料制品、废旧衣物与其他纺织品、破旧陶瓷品、难以自然降解的肉食。',NULL,'其他垃圾',23),(6468,'厨余垃圾应从产生时就与其他品种垃圾分开收集，投放前尽量沥干水分；；|有包装物的厨余垃圾应将包装物去除后分类投放，包装物应投放到对应的可回收物或其他垃圾收集容器；；|盛放厨余垃圾的容器，如塑料袋等，在投放时应予去除。','主要包括相关单位食堂、宾馆、饭店等产生的餐厨垃圾，居民日常生活产生的厨余垃圾，农贸市场、农产品批发市场产生的蔬菜瓜果垃圾、腐肉、肉碎骨、蛋壳、畜禽产品内脏等。',NULL,'厨余垃圾',4),(6469,'保持清洁干燥，避免污染；|废纸应保持平整；|立体包装物应清空内容物，清洁后压扁投放；|废玻璃制品应轻投轻放，有尖锐边角的应包裹后投放。','主要包括废纸、废塑料、废金属、废包装物、废旧纺织物、废弃电器电子产品、废玻璃、废纸塑铝复合包装等。',NULL,'可回收物',4),(6470,'注意轻放；|废灯管等易破损的有害垃圾应连带包装或包裹后投放；|废弃药品宜连带包装一并投放；杀虫剂等压力罐装容器，应排空内容物后投放；|在公共场所产生有害垃圾且未发现对应收集容器时，应携带至有害垃圾投放点妥善投放。','主要包括废电池（镉镍电池、氧化汞电池、铅蓄电池等），废荧光灯管（日光灯管、节能灯等），废温度计，废血压计，废药品及其包装物，废油漆、溶剂及其包装物，废杀虫剂、消毒剂及其包装物，废胶片及废相纸等。',NULL,'有害垃圾',4),(6471,'其他垃圾应投入其他垃圾收集容器，并保持周边环境整洁。','除有害垃圾、易腐垃圾、可回收物之外的其他生活垃圾。',NULL,'其他垃圾',4),(6472,'分类投放有害垃圾时，应注意轻放；|||废灯管等易破损的有害垃圾应连带包装或包裹后投放；||废弃药品宜连带包装一并投放；|||杀虫剂等压力罐装容器，应排空内容物后投放；|||在公共场所产生有害垃圾且未发现对应收集容器时，应携带至有害垃圾投放点妥善投放','指纳入《国家危险废物名录》,对人体健康或者自然环境造成直接或者潜在危害的，需要专门处置的物质，包括废电池(充电、扣式等)，废荧光灯管(日光灯管、节能灯等)，废温度计，废血压计，废药品及其包装物，废油漆等。',NULL,'有害垃圾',18),(6473,'厨余垃圾与其他品种垃圾分开收集；|||有包装物的厨余垃圾应将包装物去除后分类投放，包装物应投放到对应的可回收物或其他垃圾收集容器；|||盛放厨余垃圾的容器，如塑料袋等，在投放时应予去除','指在日常生活中产生的易腐性垃圾，包括相关单位食堂、宾馆、饭店等产生的餐厨垃圾,家庭厨余垃圾,农贸市场、农产品批发市场产生的蔬菜瓜果垃圾、腐肉、肉碎骨、蛋壳、畜禽产品内脏等。',NULL,'厨余垃圾',18),(6474,'分类投放可回收物时，应尽量保持清洁干燥，避免污染；|废纸应保持平整；立体包装物应清空内容物，清洁后压扁投放；|废玻璃制品应轻投轻放，有尖锐边角的应包裹后投放。','指可循环利用和资源化利用的物品，包括废纸、废塑料、废金属、废包装物、废旧纺织物、废弃电器电子产品、废玻璃等。',NULL,'可回收物',18),(6475,'其他应投入其他垃圾收集容器，并保持周边环境整洁。','指除可回收物、厨余垃圾、有害垃圾以外的混杂、难以分类的生活垃圾。',NULL,'其他垃圾',18),(6476,'各类纸应折好压平，打包好，回收时避免受到污染；|||塑料瓶等应踩扁压实并撕掉瓶身标签，瓶内残留物应用水清洗干净；|||废旧衣物应清洗干净','指适宜回收和资源利用的生活垃圾，包括纸类、塑料、金属、玻璃和织物等。',NULL,'可回收物',45),(6477,'各类废电池应保持完好，各类废灯管应保持清洁、干燥、防止破损，投放至指定收集容器；|||破碎的灯管应用胶带包裹后投放至有害垃圾收集容器','指对人体健康或者自然环境造成直接或者潜在危害的生活垃圾，包括废电池、废灯管、弃置药品、废杀虫剂、废油漆、废日用化学品及其容器，废水银产品等。',NULL,'有害垃圾',45),(6478,'厨余垃圾应沥干水分后投放至厨余垃圾收集容器，请勿将其他垃圾混入其中','指家庭中产生的菜帮菜叶、瓜果皮核、剩饭剩菜、废弃食物等易腐性垃圾。',NULL,'厨余垃圾',45),(6479,'避免混入可回收垃圾、厨余垃圾及有害垃圾','指除可回收物、有害垃圾、厨余垃圾以外的混杂、难以分类的生活垃圾，包括废弃卫生巾、一次性纸尿布、餐巾纸、烟蒂、清扫渣土以及家庭产生的花草、落叶等。',NULL,'其他垃圾',45),(6480,'玻璃类应小心轻放，以免割伤，宜袋装或容器封装后投放；|容器类应倒净，并清理干净后再投放；|纸类应尽量叠放整齐，纸盒应拆开压扁叠放；|织物类应打包整齐后再投放。','指未污染的适宜回收和资源利用的废弃物。',NULL,'可回收物',11),(6481,'废弃的荧光灯管、灯泡在投放时要打包固定，防止破损造成有害气体挥发到环境中；|过期药品化学物质会失效或变性，必须投放到有害垃圾收集容器。','指对人体健康或者自然环境造成直接或者潜在危害的废弃物。',NULL,'有害垃圾',11),(6482,'餐厨垃圾要投放到餐厨垃圾专业收集桶内，并按分类要求，不得掺杂桌布、废旧餐具、竹筷和贝壳等不易腐烂的垃圾；|厨余垃圾要沥干水分，按照分类要求装入垃圾袋，并投入易腐垃圾收集容器。','易腐垃圾主要分为餐厨垃圾和厨余垃圾两类。餐厨垃圾主要指单位食堂、餐饮服务业等产生的食物残余和废弃食用油脂等。厨余垃圾主要指居民家庭每天产生的剩菜剩饭、菜根菜叶、瓜果皮核等，以及农贸市场产生的果蔬垃圾等。',NULL,'易腐垃圾',11),(6483,'其他垃圾装入垃圾袋，并投入其他垃圾收集容器。','除去可回收物、易腐垃圾、有害垃圾之外的所有垃圾。',NULL,'其他垃圾',11),(6484,'轻投轻放；||清洁干燥，避免污染；||纸张尽量平整；||立体包装物请清空内容物，清洁后压扁投放；||有尖锐边角的，应包裹后投放','适合回收循环利用和资源化利用的废弃物。',NULL,'可回收物',29),(6485,'纯流质的食物垃圾，如牛奶等，应直接倒进下水口；|有包装物的厨余垃圾应包装物去除后分类投放，包装物请投放到对应的可回收物或其他垃圾容器；|投放厨余垃圾时，鼓励将包装物（如塑料袋）去除','日常生活中容易腐烂的生物质废弃物。',NULL,'厨余垃圾',29),(6486,'尽量沥干水分；|难以辨别类别的生活垃圾投入其他垃圾容器内','除可回收物、有害垃圾、湿垃圾以外的其他废弃物。',NULL,'其他垃圾',29),(6487,'投放时请轻拿轻放；|如有残留、易挥发请密封后投放；|易破损的请连带包装或包裹后投放；|连带包装一并投放。','对人体健康或者自然环境造成直接或者潜在危害的废弃物。',NULL,'有害垃圾',29),(6488,'投放时应轻投轻放；||可回收物应清洁干燥，避免污染；||废纸尽量平整，纸箱应拆开压扁后投放；||立体包装物应清空内容物，清洁后压扁投放；||易破损或有尖锐边角的可回收物，应包裹后投放','可回收物是指适宜回收和可循环利用的废弃物。',NULL,'可回收物',26),(6489,'电池类投放时，应轻投轻放；|废药品类应连带内层包装一并投放；|玻璃等易碎类应用纸或布包裹后投放；|液体瓶罐类应拧紧瓶盖后投放；|杀虫剂等压力罐应轻投轻放，不能挤压。','有害垃圾是指生活垃圾中对人体健康、自然环境造成直接或者潜在危害的废弃物。',NULL,'有害垃圾',26),(6490,'厨余垃圾（餐厨垃圾）应从产生时就与其他类别垃圾分开归类，去除食材食品的包装物，不得混入纸巾、餐具等杂物；|厨余垃圾（餐厨垃圾）应滤去水分后再投放；|厨余垃圾（餐厨垃圾）中的废弃食用油脂，应单独存放、交付餐厨垃圾收集运输单位；|吃剩的快餐、泡面，茶叶渣，中药渣等应沥干水分后再分类投放；|猪羊牛等动物大块骨头，榴莲壳、椰子壳等坚果果壳，蛤蜊壳、扇贝壳、海虹壳、海蛎子壳等硬质海鲜壳类，应投放到其他垃圾桶内。','厨余垃圾（餐厨垃圾）是指从事餐饮经营活动的单位和集体食堂产生的餐饮废弃物、家庭厨余垃圾以及农贸市场农副产品废弃物。',NULL,'厨余垃圾',26),(6491,'其他垃圾投放前应沥干水分；|成分复杂难以分辨类别的生活垃圾，可投入其他垃圾收集容器。','其他垃圾是指除可回收垃圾、厨余垃圾、有害垃圾、大件垃圾之外的其他生活废弃物。',NULL,'其他垃圾',26),(6492,'大件垃圾应投放至单位或小区指定堆放点。','大件垃圾是指体积大、整体性强，需要拆分再处理的废旧家具。',NULL,'大件垃圾',26);
